import React, { Component } from "react";
import { connect } from "react-redux";
import Button from "@material-ui/core/Button";
import Artists from "./TextFields/Artists";
import Movements from "./TextFields/Movements";
import Centuries from "./TextFields/Centuries";
import Branches from "./TextFields/Branches";
import {
  artistUpdate,
  movementUpdate,
  centuryUpdate,
  branchUpdate,
  fetchStart
} from "../Actions/Actions";

class Main extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <form>
        <Artists />
        <br />
        <Movements />
        <br />
        <Centuries />
        <br />
        <Branches />

        <Button
          variant="contained"
          color="secondary"
          style={{ position: "relative", bottom: 50 }}
          onClick={() => this.props.dispatch(fetchStart())}
        >
          Submit
        </Button>
      </form>
    );
  }
}

const mapStateToProps = state => {
  return {
    artist: state.form.artist,
    movement: state.form.movement,
    century: state.form.century,
    branch: state.form.branch
  };
};

const connectedOne = connect(mapStateToProps)(Main);
export default connectedOne;
